import { useState } from "react";
import {BarChart } from "./components/BarChart";
import { MockDataModel } from "./components/MockData";
import * as MockDataBarChartJSON  from "../../../public/MockDataBarChart.json"
import { BarDatum } from "@nivo/bar";


export const DashboardPage = () => {


  const [data, setData] = useState<BarDatum[]>(MockDataBarChartJSON);


  for (const key in MockDataBarChartJSON ) {
    data.push(MockDataBarChartJSON[key]);
  }

  setData(data);









    return (
    <> 
      <div className="m-20">
        <div className="d-flex justify-content-space-between align-items-center">
          <h1>Dashboard</h1>
        </div>
        <div className="d-flex justify-content-space-between align-items-center">
          <h2>Welcome to your dashboard</h2>
        </div>

      <BarChart data={data} /> 
      </div>


      <div className="container m-2 p-2 d-flex">
        <div className="d-flex justify-content-center align-items-center card-header">
          <h3>Card Header</h3>
          </div>

          <div className="card-body justify-content align-items-center">
            <h5>Card Body</h5> 

          </div>
      </div>
    </>
  );
};
